public String buildInvalidCredentialsError(
    final CredentialTypeRequired typeRequired) {
  if (isEmpty()) {
    return " " + MarshalledCredentialBinding.NO_AWS_CREDENTIALS;
  } else {
    return " " + INVALID_CREDENTIALS
        + " in " + toString() + " required: " + typeRequired;
  }
}
